g=A.C5('A standard Whot deck contains 54 cards from 5 suits: circles, squares, triangles, stars and crosses. These are numbered between 1 and 14 although not all numbers are included for each suit. The remaining 5 cards are special cards called "Whot" cards and designated the number 20',A.a(["Tap or Double Tap any card to open your cards and don't reveal to your opponent and note cards automatically closes after players except when players online game to avoid unnecessary card revealing","Double Tap on any card to hide all cards","Long press on any card to start selecting multiple cards and keep tapping to select and click the checkmark when done","Scroll left or right to reveal hidden cards","Play any card that matches the played card or wild card (20 Whot) to request for a shape and if don't have pick a card from market",k,"Play special cards like 2 which means your opponent picks 2 cards, 14 which means your opponent(s) all pick from the general market, 8 to suspend the next players, 1 to hold on all your opponent(s) and play another card again and 20 which gives you opportunity to request a shape that suits you","You win the game when you have played all your cards","The whole game then tenders if more than 2 players and determines the positions in the match"],h),g)
q=A.a(["Pawn: A Pawn moves 1 or 2 steps forward for first move and 1 for subsequent moves and 1 step diagonally when about to capture","Rook: A Rook moves 1 or multiple steps edge to edge in top, bottom, left and right direction. Basically rook moves vertically and horizontally",u.H,"Knight: A Knight moves 1 step in one edge and 2 steps in the other edge in all directions. Basically knight moves in a shape of letter L","Queen: A Queen moves 1 or multiple steps in all directions. Basically verically, horizontally and diagonally","King: A King moves 1 step in all directions.  Basically verically, horizontally and diagonally","A chess piece can only make 1 capture at a time","A chess piece captures by landing on the same spot the opponent's piece is and with its specific movement","A pawn has a special move called enpassant which occurs when a players is 2 steps away for the opponents pawn and an opponent's pawn makes its first move 2 steps forward, the players pawn can capture the pawn diagonally as if it is as a capture position and only if its the players's direct next move","A piece is pinned when a piece's movement can lead to a check of the king","A king cannot move to a place of check","When a king is on check no other piece can move except the king moving away from the check position and any other piece that can block the king check","A king can also castle in the king's side when it hasn't made any move and the rook at the king's side also hasn't made any move and there is no piece in between them and also isn't on check or the castle move wouldn't lead to a check. The king castles 2 steps to the right while the rook leave its current position and stay at the left side of the king","A king can also castle in the queen's side when it hasn't made any move and the rook at the queen's side also hasn't made any move and there is no piece in between them and also isn't on check or the castle move wouldn't lead to a check. The king castles 2 steps to the left while the rook leave its current position and stay at the right side of the king"],h)
q=A.C5("Chess is a two-players board game of strategy and war, played on a checkered board with 64 squares and specially designed pieces of contrasting colors. Each players has a king, a queen, two rooks, two bishops, two knights, and eight pawns, and moves them according to fixed rules. The goal is to force the opponent's king into checkmate, a position where it cannot avoid capture. Chesses are divided into two different colored sets. The players of the sets are referred to as White and Black, respectively. Each set consists of sixteen pieces.",A.a(["Tap on any chess piece and make your move",j,"You goal of the game is to make sure you protect your king with your piece and checkmate your opponent's king","The game is a draw when your opponent don't have any piece to move, when there is 3 repetitive game pattern, when the game ends with a king to a king or a king to a king with a bishop or a rook and when you and your opponent makes 50 moves without capturing","You win the game when your opponent's king is on checkmate meaning can no longer move in any direction"],h),q)
p=A.a(["A draught piece moves diagonally 1 step right or left and cannot move backwards","A draught piece cannot make any other move when there is an opportunity for capture","A draught piece captures by flying over the opponents piece and landing the the next empty spot diagonally","A draught piece can make multiple captures at different directions","A draught piece is crowned once it reaches its opponent's end of board","A crowned draught piece can move multiple steps both backward and forward and call also make multiple captures"],h)
p=A.C5("Draught also called Checkers is a form of the strategy board game. It is played on an 8x8 or 10x10 checkerboard with 12 pieces per side for 8x8 and 20 pieces per side for 10x10. The pieces move and capture diagonally forward, until they reach the opposite end of the board, when they are crowned and can thereafter move only forward and capture both backward and forward",A.a(["Tap on any draught piece and make your move",j,"Your goal is to capture all your opponent's pieces","When there is an opportunity for multiple capture tap at the end of your capture","The game is a draw when your opponent can no longer move but still have pieces on board, when there is 3 repetitive game pattern and when only king is moved 25 times consecutively without capturing","You win the game when your opponent no longer have a piece on board"],h),p)
o=A.a(["A ludo can be brought out only when there is a 6 in any of the dice rolled","When it players turn to play, a players cannot play opponent's ludo","The actual number of dice rolled is the number of steps any of the tapped ludo can make, not more not less","When players has no active players and cannot enter house or dice has no 6 its the opponents turn to play","When there is an opponent's ludo at the spot of the ludo step count, the opponent piece is to start its movement round again from ludo house while the players ludo passes and is assumed to have completed all steps","When there is players ludo at the spot of the ludo step count, it is assumed that both players's ludo are at the same spot"],h)
o=A.C5("Ludo is a strategy board game for two to four players, in which the players race their four tokens from start to finish according to the rolls of a single die",A.a(["Tap the roll dice button to roll dice","Tap on any ludo to play, If rolled 6 in any of the dice you have an opportunity to bring a ludo out or play your dice count and move steps ahead. You can count the dice seperately or play the total count",k,"If your ludo step is equal to the spot where your opponent is, your ludo has passed, while your opponent starts again","If your ludo step is equal to your players's spot, your players are combined on that spot","If your ludo has completely gone round the entire board and entered house your ludo passes","You win a point when all your ludos are out of the game"],h),o)
